window.bookSummaryJSON = "<p><b>Pretty lies. Dirty secrets. And a campus king determined to dominate me.</b></p> <p>My best friend is missing, and it's clear that the Sacred Sons know more than they're willing to admit. And as much as I despise them, I need answers, so I decide I'll play them at their own vicious game.</p> <p>When I'm drawn deeper into the viper's den, and my life is threatened, I'm faced with an impossible choice—trust the handsome devil I know or face a world of unknown dangers myself.</p> <p>The wrong choice could be the last one I make…</p>"; 
